Creates an empty [TensorBuffer](#class:tf.TensorBuffer) with the specified `shape` and `dtype`.

The values are stored in cpu as [TypedArray](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/TypedArray). Fill the buffer using
`buffer.set()`, or by modifying directly `buffer.values`. When done,
call `buffer.toTensor()` to get an immutable [Tensor](#class:tf.Tensor) with those values.

When done, call `buffer.toTensor()` to get an immutable [Tensor](#class:tf.Tensor) with those
values.

```js
// Create a buffer and set values at particular indices.
const buffer = dl.buffer([2, 2]);
buffer.set(3, 0, 0);
buffer.set(5, 1, 0);

// Convert the buffer back to a tensor.
buffer.toTensor().print();
```

