const c = dl.tensor1d([5, 6]);
dl.stack([a, b, c]).print();
```

The [Model](#class:tf.Model) class adds training & evaluation routines to a `Container`.

A [Model](#class:tf.Model) is the basic unit of training, inference and evaluation in
TensorFlow.js. To create a `Model, use [tf.model()](#tf.model).

To create a [Model](#class:tf.Model), specify its input(s) and output(s). Inputs are
[SymbolicTensor](#class:tf.SymbolicTensor)s provided by `Input` layers. Outputs are [SymbolicTensor](#class:tf.SymbolicTensor)s
provided by other layers that perform mathematical and neural-network
operations.

For example, the following code snippet defines a model consisting of
two [tf.layers.dense()](#tf.layers.dense) layers, with of 10 and 4 units, respectively.

```js
// Define input, which has a size of 5 (not including batch dimension).
const input = tf.input({shape: [5]});

// First dense layer uses relu activation.
const denseLayer1 = tf.layers.dense({units: 10, activation: 'relu'});
// Second dense layer uses softmax activation.
const denseLayer2 = tf.layers.dense({units: 2, activation: 'softmax'});

// Obtain the output symbolic tensor by applying the layers on the input.
const output = denseLayer2.apply(denseLayer1.apply(input));

// Create the model based on the inputs.
const model = tf.model({inputs: input, outputs: output});

// The model can be used for training, evaluation and prediction.
// For example, the following line runs prediction with the model on
// some fake data.
model.predict(tf.ones([2, 5])).print();
```

See also:
   [Sequential](#class:tf.Sequential), `modelFromJSON`, [tf.loadModel()](#tf.loadModel).

`Input()` is used to instantiate a SymbolicTensor, and represents
the input to a model.

Example:

     // this is a logistic regression in TF.js Layers:
     x = new Input(shape=[32]);
     y = new Dense(16, activation='softmax').apply(x);
     model = new Model(x, y);

