Provided `f(x)`, returns another function `g(x, dy?)`, which gives the
gradient of `f(x)` with respect to `x`.

If `dy` is provided, the gradient of `f(x).mul(dy).sum()` with respect to
`x` is computed instead. `f(x)` must take a single tensor `x` and return a
single tensor `y`. If `f()` takes multiple inputs, use [tf.grads()](#tf.grads) instead.

```js
// f(x) = x ^ 2
const f = x => x.square();
// f'(x) = 2x
const g = dl.grad(f);

const x = dl.tensor1d([2, 3]);
g(x).print();
```

```js
// f(x) = x ^ 3
const f = x => x.pow(dl.scalar(3, 'int32'));
// f'(x) = 3x ^ 2
const g = dl.grad(f);
// f''(x) = 6x
const gg = dl.grad(g);

const x = dl.tensor1d([2, 3]);
gg(x).print();
```

Provided `f(x1, x2,...)`, returns another function `g([x1, x2,...], dy?)`,
which gives an array of gradients of `f()` with respect to each input
[`x1`,`x2`,...].

If `dy` is passed when calling `g()`, the gradient of
`f(x1,...).mul(dy).sum()` with respect to each input is computed instead.
The provided `f` must take one or more tensors and return a single tensor
`y`. If `f()` takes a single input, we recommend using [tf.grad()](#tf.grad) instead.

```js
// f(a, b) = a * b
const f = (a, b) => a.mul(b);
// df / da = b, df / db = a
const g = dl.grads(f);

const a = dl.tensor1d([2, 3]);
const b = dl.tensor1d([-2, -3]);
const [da, db] = g([a, b]);
console.log('da');
da.print();
console.log('db');
db.print();
```

Overrides the gradient computation of a function `f`.

Takes a function
`f(...inputs) => {value: Tensor, gradFunc: dy => Tensor[]}` and returns
another function `g(...inputs)` which takes the same inputs as `f`. When
called, `g` returns `f().value`. In backward mode, custom gradients with
respect to each input of `f` are computed using `f().gradFunc`.

```js
const customOp = dl.customGrad(x => {
   // Override gradient of our custom x ^ 2 op to be dy * abs(x);
   return {value: x.square(), gradFunc: dy => [dy.mul(x.abs())]};
});

const x = dl.tensor1d([-1, -2, 3]);
const dx = dl.grad(x => customOp(x));

console.log(`f(x):`);
customOp(x).print();
console.log(`f'(x):`);
dx(x).print();
```

Like `dl.grad`, but also returns the value of `f()`. Useful when `f()`
returns a metric you want to show.

The result is a rich object with the following properties:
- grad: The gradient of `f(x)` w.r.t `x` (result of [tf.grad()](#tf.grad)).
- value: The value returned by `f(x)`.

```js
// f(x) = x ^ 2
const f = x => x.square();
// f'(x) = 2x
const g = dl.valueAndGrad(f);

const x = dl.tensor1d([2, 3]);
const {value, grad} = g(x);

console.log('value');
value.print();
console.log('grad');
grad.print();
```

Like [tf.grads()](#tf.grads), but returns also the value of `f()`. Useful when `f()`
returns a metric you want to show.

The result is a rich object with the following properties:
- grads: The gradients of `f()` w.r.t each input (result of [tf.grads()](#tf.grads)).
- value: The value returned by `f(x)`.

```js
// f(a, b) = a * b
const f = (a, b) => a.mul(b);
// df/da = b, df/db = a
const g = dl.valueAndGrads(f);

const a = dl.tensor1d([2, 3]);
const b = dl.tensor1d([-2, -3]);
const {value, grads} = g([a, b]);

const [da, db] = grads;

console.log('value');
value.print();

console.log('da');
da.print();
console.log('db');
db.print();
```

Computes and returns the gradient of f(x) with respect to the list of
trainable variables provided by `varList`. If no list is provided, it
defaults to all trainable variables.

```js
const a = dl.variable(dl.tensor1d([3, 4]));
const b = dl.variable(dl.tensor1d([5, 6]));
const x = dl.tensor1d([1, 2]);

// f(a, b) = a * x ^ 2 + b * x
const f = () => a.mul(x.square()).add(b.mul(x)).sum();
// df/da = x ^ 2, df/db = x
const {value, grads} = dl.variableGrads(f);

Object.keys(grads).forEach(varName => grads[varName].print());
```

Constructs a [SGDOptimizer](#class:tf.train.Optimizer) that uses stochastic gradient descent.

```js
// Fit a quadratic function by learning the coefficients a, b, c.
const xs = dl.tensor1d([0, 1, 2, 3]);
const ys = dl.tensor1d([1.1, 5.9, 16.8, 33.9]);

const a = dl.scalar(Math.random()).variable();
const b = dl.scalar(Math.random()).variable();
const c = dl.scalar(Math.random()).variable();

// y = a * x^2 + b * x + c.
const f = x => a.mul(x.square()).add(b.mul(x)).add(c);
const loss = (pred, label) => pred.sub(label).square().mean();

const learningRate = 0.01;
const optimizer = dl.train.sgd(learningRate);

// Train the model.
for (let i = 0; i < 10; i++) {
   optimizer.minimize(() => loss(f(xs), ys));
}

// Make predictions.
console.log(
     `a: ${a.dataSync()}, b: ${b.dataSync()}, c: ${c.dataSync()}`);
const preds = f(xs).dataSync();
preds.forEach((pred, i) => {
   console.log(`x: ${i}, pred: ${pred}`);
});
```

Executes the provided function `f` and after it is executed, cleans up all
intermediate tensors allocated by `f` except those returned by `f`.
`f` must not return a Promise (async functions not allowed).
The returned result can be a complex object, however tidy only walks the
top-level properties (depth 1) of that object to search for tensors, or
lists of tensors that need to be tracked in the parent scope.

Using this method helps avoid memory leaks. In general, wrap calls to
operations in [tf.tidy()](#tf.tidy) for automatic memory cleanup.

When in safe mode, you must enclose all [Tensor](#class:tf.Tensor) creation and ops
inside a [tf.tidy()](#tf.tidy) to prevent memory leaks.

```js
// y = 2 ^ 2 + 1
const y = dl.tidy(() => {
   // a, b, and one will be cleaned up when the tidy ends.
   const one = dl.scalar(1);
   const a = dl.scalar(2);
   const b = a.square();

   console.log('numTensors (in tidy): ' + dl.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + dl.memory().numTensors);
y.print();
```

Keeps a [Tensor](#class:tf.Tensor) generated inside a [tf.tidy()](#tf.tidy) from being disposed
automatically.

```js
let b;
const y = dl.tidy(() => {
   const one = dl.scalar(1);
   const a = dl.scalar(2);

   // b will not be cleaned up by the tidy. a and one will be cleaned up
   // when the tidy ends.
   b = dl.keep(a.square());

   console.log('numTensors (in tidy): ' + dl.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + dl.memory().numTensors);
console.log('y:');
y.print();
console.log('b:');
b.print();
```
